import React from 'react';
import {addSmsActionCreator, updateNewSmsActionCreator} from "../../redux/dialogs-reducer";
import Dialogs from "./dialogs";
import {connect} from "react-redux";
import {AuthRedirectWith} from "../../hoc/AuthRedirect";
import {withRouter} from "react-router-dom";

let AuthRedirectCompocnent= AuthRedirectWith(Dialogs);
let mapStateToPropsForRedirect=(state)=>{
    return {isAuth:state.Auth.isAuth};
}
AuthRedirectComponent=connect(mapStateToPropsForRedirect)(AuthRedirectCompocnent);
let mapStateToProps = (state) => {
    return {
        messagePage: state.messagePage,
        isAuth:state.Auth.isAuth
    }
}

let WithUrlDataContainerComponent =withRouter(AuthRedirectCompocnent);

const DialogsContainer = connect(mapStateToProps, {addSmsActionCreator,updateNewSmsActionCreator})(WithUrlDataContainerComponent);
export default DialogsContainer;
